import React from 'react';
import {
  Routes,
  Route,
} from "react-router-dom";

import Layout from 'components/Layout';
import HomePage from 'pages/HomePage';
import ContactsPage from 'pages/ContactsPage';
import LoginPage from 'pages/LoginPage';
import RegisterPage from 'pages/RegisterPage';

import PublicRoute from 'components/PublicRoute';
import PrivateRoute from 'components/PrivateRoute';

import s from './App.module.css';

//TODO: lazy loading

export default function App() {

  return (


    <Routes>

        <Route path='/' element={<Layout />}>
        <PublicRoute index><HomePage /></PublicRoute>
        <PrivateRoute path='contacts'><ContactsPage /></PrivateRoute>
        <PublicRoute path='login' restricted redirectTo="/contacts"><LoginPage /></PublicRoute>
        <PublicRoute path='register' restricted><RegisterPage/></PublicRoute>

        </Route>
      </Routes>


    );
};
